import {USER_LOGIN_SUCCESS, USER_LOGIN_FAIL} from '../types'

function auth(state=[], action){
    switch (action.type) {
        case USER_LOGIN_SUCCESS:
            return {
                ...state,
                action
            }
        case USER_LOGIN_FAIL:
            return {
                ...state,
                action
            }
        default:
            break;
    }
}

export default auth
